  }

function IMG ({IMG} : IProps) {
   

const IMGs = IMG;

console.log(IMGs)

     
        return (
            <div>
                <Layout>
            <div className="flex mt-10 flex-row">
                
      {IMGs.map((art:any ) => (
          <div className="w3-card ">
          <img className=" m-10 w3-card w3-left img6  " src={art.urls.thumb}/>  
      <Link href={art.links.html}><button className="w3-button w3-round-xlarge bg-gray-500 w3-red">Download</button></Link>
          </div>
         
       
        ))}
        
         
            </div>
            </Layout>
            </div>
        )
    
}


export default IMG

export async function getServerSideProps () {

    const API = await fetch ("https://api.unsplash.com/photos/?client_id=KkBgR-UR5bzc26yPltIXqo_Jsd5f-h2Hv_rL4zzpG2k")

    const IMG = await API.json();

    return{
        props :{
           IMG,
        }
    }
    
}
